import React from 'react';

import './UserItem.css';

const userItem = props => (
  <li key={props.userId} className="users__list-item">
    <div>
      <h1>{props.name}</h1>
      <p>
        {props._id}
      </p>
      <p>
        {props.role}
      </p>
      <p>
        {props.email}
      </p>
    </div>
    <div>
    <button className="btn" onClick={props.onDetail.bind(this, props.id)}>
          View Details
        </button>
    </div>
  </li>
);

export default userItem;
